import React, { useState }from "react";
import AddDentist from './AddDentist'
import UserList from "./UserList";
import dentists from "./utils"

export default function Home() {
    const [contacts, setContacts] = useState([]);

    const addContact = contact => {
        setContacts([...contacts, contact]); 
    }
    console.log(contacts);

    return(
    <div>
        {dentists.map((dentist) =>
        <div key={dentist.phone}>
            <input type="text">{dentist.first_name}</input>
            <input type="text">{dentist.last_name}</input>
            <input type="text">{dentist.email}</input>
            <input type="text">{dentist.phone}</input>
        </div>)}
        <AddDentist addContact={addContact}/>
        <UserList contacts={contacts}/>
    </div>

    )
}
